      "description": "Notebooks donation to the Primary section students of Chennai Corporation school, CIT Nagar 4th main road..",
      "fullDescription": "The World Environment Day just got greener and greener. On behalf of Kodai Charitable  Foundation, directors Mrs. Srividya Hariharan, Mr. Ganesan Manikandan and Mr. Vittal  Srinivasamurthi  donated countryside tree saplings and around 400 additional note books to the CIT Nagar Corporation school on 5th June 2025. In a heartwarming demonstration of the commitment to both environmental sustainability and educational upliftment, Kodai Charitable Foundation had organised this inspiring event. The primary school students alongwith a few wellwishers, directors of the foundation, staff members and the principal of the primary division recited the world environment day pledge as part of the celebration. Smt. Valarmathy Sundaram, headmistress of the primary division and Smt. Maheshwari, principal of the higher secondary division extended their valuable support throughout the event and pledged to take care of the donated saplings in a sustainable manner",
